WeaponIndex = 0
Flag = true
Count = 1
WeaponIndexTemp = 0
function OnEvent(event, arg)
  if event == "PROFILE_ACTIVATED" then
    EnablePrimaryMouseButtonEvents(true)
  end
  
  if Wireless then
    --The mouse I using is a wireless mouse
    Sleep(1)
  end
  
  while IsMouseButtonPressed(1) and Flag do
    if WeaponIndex > 0 and WeaponIndex <= #WeaponList then
      if Count < #WeaponList[WeaponIndex] then
        --run
        if Count == 1 then
          TimeStart = GetRunningTime
        end
        MoveMouseRelative(WeaponList[WeaponIndex][Count].x/Sensitivity, WeaponList[WeaponIndex][Count].y/Sensitivity)
        Wait(GetRunningTime() + WeaponList[WeaponIndex][Count].d)
        Count = Count + 1
      else --[[all bullets were shot
	    TODO:move the course back
	    ]]
        Flag = false
		Count = 1
		ReleaseMouseButton(1)
      end
    end
  end
  
  if event == "MOUSE_BUTTON_RELEASED" then
    if arg == 1 then
      if WeaponIndex ~= 0 then
        Flag = true
		Count = 1
        --TODO:move the course back
      end
    end
  end
  
  if event == "MOUSE_BUTTON_PRESSED" then
    if arg == StopKey then
	  WeaponIndex = 0
	elseif arg == Ak47Key then
	  if WeaponIndex == Ak47Index then
	    WeaponIndex = GalirIndex
	  elseif WeaponIndex == GalirIndex then
	    WeaponIndex = Sg553Index
	  else
	    WeaponIndex = Ak47Index
	  end
	elseif arg == M4a4Key then
	  if WeaponIndex == M4a4Index then
	    WeaponIndex = FamasIndex
	  elseif WeaponIndex == FamasIndex then
	    WeaponIndex = M4a1Index
	  else
	    WeaponIndex = M4a4Index
	  end
	elseif arg == Mac10Key then
	  if WeaponIndex == Mac10Index then
	    WeaponIndex = Mp9Index
	  elseif WeaponIndex == Mp9Index then
	    WeaponIndex = BizonIndex
	  else
	    WeaponIndex = Mac10Index
	  end
	else
    end
  end
end

